<p>Mục đ&iacute;ch thu thập th&ocirc;ng tin c&aacute; nh&acirc;n</p>

<p>Để truy cập v&agrave; sử dụng một số dịch vụ tại TOMATO, bạn c&oacute; thể sẽ được y&ecirc;u cầu đăng k&yacute; với ch&uacute;ng t&ocirc;i th&ocirc;ng tin c&aacute; nh&acirc;n (Email, Họ t&ecirc;n, Số điện thoại li&ecirc;n lạc, &hellip;). Mọi th&ocirc;ng tin khai b&aacute;o phải đảm bảo t&iacute;nh ch&iacute;nh x&aacute;c v&agrave; hợp ph&aacute;p. C&ocirc;ng ty TOMATO&nbsp;kh&ocirc;ng chịu mọi tr&aacute;ch nhiệm li&ecirc;n quan đến ph&aacute;p luật của th&ocirc;ng tin khai b&aacute;o.&nbsp;</p>

<p>Ch&uacute;ng t&ocirc;i cũng c&oacute; thể thu thập th&ocirc;ng tin về số lần viếng thăm, bao gồm số trang bạn xem, số links (li&ecirc;n kết) bạn click v&agrave; những th&ocirc;ng tin kh&aacute;c li&ecirc;n quan đến việc kết nối đến <a data-saferedirecturl="https://www.google.com/url?hl=vi&amp;q=http://tomatoonline.edu.vn&amp;source=gmail&amp;ust=1532077305742000&amp;usg=AFQjCNFAra5Xv0LgcXPJt8eUfvQYp65YOA" href="http://tomatoonline.edu.vn/" target="_blank">tomatoonline.edu.vn</a>. Ch&uacute;ng t&ocirc;i cũng thu thập c&aacute;c th&ocirc;ng tin m&agrave; tr&igrave;nh duyệt Web (Browser) bạn sử dụng mỗi khi truy cập v&agrave;o&nbsp;<a data-saferedirecturl="https://www.google.com/url?hl=vi&amp;q=http://tomatoonline.edu.vn&amp;source=gmail&amp;ust=1532077305742000&amp;usg=AFQjCNFAra5Xv0LgcXPJt8eUfvQYp65YOA" href="http://tomatoonline.edu.vn/" target="_blank">tomatoonline.edu.vn</a>, bao gồm: Địa chỉ IP, loại Browser, ng&ocirc;n ngữ sử dụng, thời gian v&agrave; những địa chỉ m&agrave; Browser truy xuất đến.</p>

<p>&nbsp;</p>

<p>&nbsp;</p>

<p><strong>&nbsp;Sử dụng th&ocirc;ng tin c&aacute; nh&acirc;n</strong></p>

<p>&nbsp;</p>

<p>&nbsp;</p>

<p>C&ocirc;ng ty TOMATO&nbsp;thu thập v&agrave; sử dụng th&ocirc;ng tin c&aacute; nh&acirc;n bạn với mục đ&iacute;ch ph&ugrave; hợp v&agrave; ho&agrave;n to&agrave;n tu&acirc;n thủ nội dung của &ldquo;Ch&iacute;nh s&aacute;ch bảo mật&rdquo; n&agrave;y. &nbsp;Khi cần thiết, ch&uacute;ng t&ocirc;i c&oacute; thể sử dụng những th&ocirc;ng tin n&agrave;y để li&ecirc;n hệ trực tiếp với bạn dưới c&aacute;c h&igrave;nh thức như: Gửi thư ngỏ, đơn đặt h&agrave;ng, thư cảm ơn, th&ocirc;ng tin về kỹ thuật v&agrave; bảo mật&hellip;</p>

<p>&nbsp;</p>

<h4><strong>Chia sẻ th&ocirc;ng tin c&aacute; nh&acirc;n</strong></h4>

<p>&nbsp;</p>

<p>Ngoại trừ c&aacute;c trường hợp về sử dụng th&ocirc;ng tin c&aacute; nh&acirc;n như đ&atilde; n&ecirc;u trong ch&iacute;nh s&aacute;ch n&agrave;y, ch&uacute;ng t&ocirc;i cam kết sẽ kh&ocirc;ng tiết lộ th&ocirc;ng tin c&aacute; nh&acirc;n bạn ra ngo&agrave;i.</p>

<p>&nbsp;</p>

<p>Trong một số trường hợp, ch&uacute;ng t&ocirc;i c&oacute; thể thu&ecirc; một đơn vị độc lập để tiến h&agrave;nh c&aacute;c dự &aacute;n nghi&ecirc;n cứu thị trường v&agrave; khi đ&oacute; th&ocirc;ng tin của bạn sẽ được cung cấp cho đơn vị n&agrave;y để tiến h&agrave;nh dự &aacute;n. B&ecirc;n thứ ba n&agrave;y sẽ bị r&agrave;ng buộc bởi một thỏa thuận về bảo mật m&agrave; theo đ&oacute; họ chỉ được ph&eacute;p sử dụng những th&ocirc;ng tin được cung cấp cho mục đ&iacute;ch ho&agrave;n th&agrave;nh dự &aacute;n.</p>

<p>&nbsp;</p>

<p>Ch&uacute;ng t&ocirc;i c&oacute; thể tiết lộ hoặc cung cấp th&ocirc;ng tin c&aacute; nh&acirc;n của bạn trong c&aacute;c trường hợp thật sự cần thiết như sau: (a) khi c&oacute; y&ecirc;u cầu của c&aacute;c cơ quan ph&aacute;p luật; (b) trong trường hợp m&agrave; ch&uacute;ng t&ocirc;i tin rằng điều đ&oacute; sẽ gi&uacute;p ch&uacute;ng t&ocirc;i bảo vệ quyền lợi ch&iacute;nh đ&aacute;ng của m&igrave;nh trước ph&aacute;p luật; (c) t&igrave;nh huống khẩn cấp v&agrave; cần thiết để bảo vệ quyền an to&agrave;n c&aacute; nh&acirc;n của c&aacute;c th&agrave;nh vi&ecirc;n kh&aacute;c.</p>

<p>&nbsp;</p>

<h4><strong>Truy xuất th&ocirc;ng tin c&aacute; nh&acirc;n</strong></h4>

<p>&nbsp;</p>

<p>Bất cứ thời điểm n&agrave;o bạn cũng c&oacute; thể truy cập v&agrave; chỉnh sửa những th&ocirc;ng tin c&aacute; nh&acirc;n của m&igrave;nh theo c&aacute;c links th&iacute;ch hợp m&agrave; ch&uacute;ng t&ocirc;i cung cấp.</p>

<p>&nbsp;</p>

<h4><strong>Bảo mật th&ocirc;ng tin c&aacute; nh&acirc;n</strong></h4>

<p>&nbsp;</p>

<p>C&ocirc;ng ty TOMATO&nbsp;cam kết bảo mật th&ocirc;ng tin c&aacute; nh&acirc;n của bạn bằng mọi c&aacute;ch thức c&oacute; thể. Ch&uacute;ng t&ocirc;i sẽ sử dụng nhiều c&ocirc;ng nghệ bảo mật th&ocirc;ng tin kh&aacute;c nhau nhằm bảo vệ th&ocirc;ng tin n&agrave;y kh&ocirc;ng bị truy lục, sử dụng hoặc tiết lộ ngo&agrave;i &yacute; muốn.</p>

<p>&nbsp;</p>

<p>Ch&uacute;ng t&ocirc;i&nbsp;khuyến c&aacute;o bạn n&ecirc;n bảo mật c&aacute;c th&ocirc;ng tin li&ecirc;n quan đến mật khẩu truy xuất của bạn v&agrave; kh&ocirc;ng n&ecirc;n chia sẻ với bất kỳ người n&agrave;o kh&aacute;c. Nếu sử dụng m&aacute;y t&iacute;nh chung nhiều người, bạn n&ecirc;n đăng xuất, hoặc tho&aacute;t hết tất cả cửa sổ Website đang mở.&nbsp;</p>

<p>&nbsp;</p>

<h4><strong>Thay đổi về ch&iacute;nh s&aacute;ch</strong></h4>

<p>&nbsp;</p>

<p>&nbsp;Nội dung của &ldquo;Ch&iacute;nh s&aacute;ch bảo mật&rdquo; n&agrave;y c&oacute; thể thay đổi để ph&ugrave; hợp với c&aacute;c nhu cầu của TOMATO&nbsp;cũng như nhu cầu v&agrave; sự phản hồi từ kh&aacute;ch h&agrave;ng nếu c&oacute;. Khi cập nhật nội dung ch&iacute;nh s&aacute;ch n&agrave;y, ch&uacute;ng t&ocirc;i sẽ chỉnh sửa lại thời gian &ldquo;Cập nhật lần cuối&rdquo; b&ecirc;n tr&ecirc;n.&nbsp;</p>

<p>&nbsp;</p>

<p>Nội dung &ldquo;Ch&iacute;nh s&aacute;ch bảo mật&rdquo; n&agrave;y chỉ &aacute;p dụng tại C&ocirc;ng ty TOMATO, kh&ocirc;ng bao gồm hoặc li&ecirc;n quan đến c&aacute;c b&ecirc;n thứ ba đặt quảng c&aacute;o hay c&oacute; links tại&nbsp;<a data-saferedirecturl="https://www.google.com/url?hl=vi&amp;q=http://tomatoonline.edu.vn&amp;source=gmail&amp;ust=1532077305742000&amp;usg=AFQjCNFAra5Xv0LgcXPJt8eUfvQYp65YOA" href="http://tomatoonline.edu.vn/" target="_blank">tomatoonline.edu.vn</a>. Do đ&oacute;, ch&uacute;ng t&ocirc;i đề nghị bạn đọc v&agrave; tham khảo kỹ nội dung &ldquo;Ch&iacute;nh s&aacute;ch bảo mật&rdquo; của từng website m&agrave; bạn đang truy cập.</p>

<p>&nbsp;</p>

<h4><strong>Th&ocirc;ng tin li&ecirc;n hệ</strong></h4>

<p>&nbsp;</p>

<p>Ch&uacute;ng t&ocirc;i lu&ocirc;n hoan ngh&ecirc;nh c&aacute;c &yacute; kiến đ&oacute;ng g&oacute;p, li&ecirc;n hệ v&agrave; phản hồi th&ocirc;ng tin từ bạn về &ldquo;Ch&iacute;nh s&aacute;ch bảo mật&rdquo; n&agrave;y. Nếu bạn c&oacute; những thắc mắc li&ecirc;n quan xin vui l&ograve;ng li&ecirc;n hệ theo địa chỉ:</p>

