<p><span style="font-size:14px">Bất kể nội dung b&agrave;i viết n&agrave;o c&oacute; t&iacute;nh ph&iacute; hay miễn ph&iacute; của trang web n&agrave;y v&iacute; dụ như b&agrave;i viết, h&igrave;nh ảnh, minh họa, video.v.v... đều được bảo hộ quyền t&aacute;c giả bởi Luật Bản quyền của Việt Nam v&agrave; c&aacute;c điều ước quốc tế.</span></p>

<p><span style="font-size:14px">Kh&ocirc;ng được sao ch&eacute;p, gửi, điều chỉnh, ph&aacute;t h&agrave;nh , b&agrave;y b&aacute;n bất cứ sản phẩm n&agrave;o do <strong>TomatoOnline.edu.vn</strong> cung cấp dưới mọi h&igrave;nh thức khi chưa được sự cho ph&eacute;p của C&ocirc;ng ty. Trong trường hợp c&ocirc;ng ty ph&aacute;t hiện ra sẽ ngay lập tức kh&oacute;a t&agrave;i toản m&agrave; người d&ugrave;ng sử dụng t&agrave;i khoản đ&oacute; để ch&agrave;o b&aacute;n hoặc nhượng lại cho người kh&aacute;c m&agrave; kh&ocirc;ng cần b&aacute;o trước.<br />
Logo của C&ocirc;ng ty l&agrave; nh&atilde;n hiệu đ&atilde; đăng k&yacute; của C&ocirc;ng ty tại Việt Nam.<br />
Trang web n&agrave;y cung cấp dịch vụ truy cập c&aacute;c t&agrave;i liệu gi&aacute;o dục nhằm mục đ&iacute;ch học ngoại ngữ. Tất cả nội dung b&agrave;i học đều thuộc về C&ocirc;ng ty. Bằng c&aacute;ch đăng k&iacute; mua c&aacute;c g&oacute;i kh&oacute;a học trực tuyến, qu&yacute; kh&aacute;ch sẽ nhận được quyền truy cập v&agrave;o tất cả c&aacute;c nội dung của kh&oacute;a học đ&atilde; mua.<br />
C&ocirc;ng ty c&oacute; quyền thay đổi c&aacute;c điều kiện theo thời gian cho ph&ugrave; hợp v&agrave; việc tiếp tục sử dụng trang web của bạn đồng nghĩa với việc qu&yacute; kh&aacute;ch đ&atilde; chấp nhận với những điều chỉnh của c&aacute;c điều khoản n&agrave;y.<br />
Qu&yacute; kh&aacute;ch phải giữ b&iacute; mật mật khẩu của m&igrave;nh. Ph&iacute;a C&ocirc;ng ty xin đề nghị rằng qu&yacute; kh&aacute;ch n&ecirc;n thay đổi mật khẩu đăng nhập thường xuy&ecirc;n.<br />
Việc th&acirc;m nhập v&agrave;o trang web của C&ocirc;ng ty bằng c&aacute;ch sử dụng mật khẩu hay sử dụng hệ thống bất ch&iacute;nh; khi chưa được ph&eacute;p m&agrave; đăng tải những nội dung kh&ocirc;ng ph&ugrave; hợp l&ecirc;n trang web của C&ocirc;ng ty, sử dụng th&ocirc;ng tin với mục đ&iacute;ch bất ch&iacute;nh l&agrave; những h&agrave;nh vi bị nghi&ecirc;m cấm.<br />
Kh&ocirc;ng được ph&eacute;p sử dụng trang web của C&ocirc;ng ty trong trường hợp trang web n&agrave;y kết nối với c&aacute;c trang web kh&aacute;c được quản l&yacute; v&agrave; cung cấp với c&ocirc;ng ty kh&aacute;c nhưng kh&ocirc;ng thuộc c&ocirc;ng ty li&ecirc;n kết với ph&iacute;a C&ocirc;ng ty ch&uacute;ng t&ocirc;i.<br />
Ch&uacute;ng t&ocirc;i sẽ kh&ocirc;ng chịu tr&aacute;ch nhiệm đối với bất kỳ th&ocirc;ng tin, dữ liệu, sản phẩm hoặc dịch vụ n&agrave;o được quản l&yacute; v&agrave; cung cấp bởi trang web kết nối với trang web của C&ocirc;ng ty ch&uacute;ng t&ocirc;i.<br />
Cho d&ugrave; qu&yacute; kh&aacute;ch thiết lập li&ecirc;n kết với trang web của c&aacute;c c&ocirc;ng ty m&agrave; kh&ocirc;ng thuộc c&ocirc;ng ty li&ecirc;n kết với C&ocirc;ng ty ch&uacute;ng t&ocirc;i, th&igrave; ch&uacute;ng t&ocirc;i cũng kh&ocirc;ng giới thiệu hay bảo mật c&aacute;c th&ocirc;ng tin về việc sử dụng dịch vụ, h&agrave;ng h&oacute;a, th&ocirc;ng tin được đăng tải v&agrave; quản l&yacute; bởi c&aacute;c c&ocirc;ng ty đ&oacute;. V&agrave; ch&uacute;ng t&ocirc;i sẽ kh&ocirc;ng chịu tr&aacute;ch nhiệm trong trường hợp xảy ra khiếm khuyết với những sản phẩm hay dịch vụ được quảng c&aacute;o v&agrave; được đăng tải tr&ecirc;n những trang web của c&aacute;c c&ocirc;ng ty đ&oacute;. Trang web của c&aacute;c c&ocirc;ng ty kh&aacute;c thiết lập những quy định ri&ecirc;ng v&agrave; kh&aacute;c với trang web của C&ocirc;ng ty ch&uacute;ng t&ocirc;i, n&ecirc;n ph&iacute;a C&ocirc;ng ty ch&uacute;ng t&ocirc;i cũng kh&ocirc;ng chịu tr&aacute;ch nhiệm đối với hệ thống bảo mật tr&ecirc;n trang web của c&aacute;c c&ocirc;ng ty đ&oacute;.<br />
C&aacute;c hồ sơ đăng k&yacute; th&agrave;nh vi&ecirc;n của qu&yacute; kh&aacute;ch v&agrave;/hoặc th&ocirc;ng tin thu thập từ kh&aacute;ch h&agrave;ng c&aacute; nh&acirc;n được coi l&agrave; bảo mật, v&agrave; sẽ được xử l&yacute; theo Ch&iacute;nh s&aacute;ch bảo mật của C&ocirc;ng ty. Li&ecirc;n quan đến Ch&iacute;nh s&aacute;ch bảo mật của &ocirc;ng ty, xin vui l&ograve;ng tham khảo tại đ&acirc;y<br />
Ch&uacute;ng t&ocirc;i đề nghị qu&yacute; kh&aacute;ch n&ecirc;n sử dụng c&aacute;c tr&igrave;nh duyệt web để sử dụng v&agrave; được cập nhật mới nhất như Safari, FireFox, Google Chrome v&agrave; Internet Explorer (IE 9 trở đi).<br />
Trang web của ch&uacute;ng t&ocirc;i sử dụng Javascript cho một số h&igrave;nh ảnh động hay phim ảnh. Trong trường hợp qu&yacute; kh&aacute;ch sử dụng thiết bị kh&ocirc;ng c&oacute; t&iacute;ch hợp Javascript, qu&yacute; kh&aacute;ch c&oacute; thể sẽ kh&ocirc;ng thể xem được c&aacute;c ảnh động hoặc một số phần thiết kế kh&aacute;c của trang web sẽ kh&ocirc;ng được hiển thị một c&aacute;ch ch&iacute;nh x&aacute;c.<br />
Để đăng nhập v&agrave;o trang web của C&ocirc;ng ty ch&uacute;ng t&ocirc;i, qu&yacute; kh&aacute;ch phải sử dụng t&agrave;i khoản c&aacute; nh&acirc;n đ&atilde; được k&iacute;ch hoạt. Nếu kh&ocirc;ng sử dụng t&agrave;i khoản c&aacute; nh&acirc;n đ&atilde; được k&iacute;ch hoạt, qu&yacute; kh&aacute;ch sẽ kh&ocirc;ng thể đăng nhập v&agrave;o trang web của C&ocirc;ng ty được.<br />
C&ocirc;ng ty ch&uacute;ng t&ocirc;i quy định những h&agrave;nh động sau l&agrave; những điều bị cấm. Qu&yacute; kh&aacute;ch kh&ocirc;ng được ph&eacute;p thực hiện những điều n&agrave;y.</span></p>

