<p><span style="font-size:14px"><span style="color:#27ae60"><strong>1. Giấy tờ chuẩn bị cho kỳ thi TOPIK tiếng H&agrave;n (준비물)</strong></span><br />
&nbsp;<br />
C&aacute;c loại giấy tờ sẽ được kiểm tra rất chặt chẽ trước khi v&agrave;o ph&ograve;ng thi, th&iacute; sinh đặc biệt cần lưu t&acirc;m, n&ecirc;n cẩn thận kiểm tra trước khi ra khỏi nh&agrave; để tr&aacute;nh t&igrave;nh trạng thiếu hoặc mất trước cận kề giờ thi:<br />
&bull;&nbsp;&nbsp; &nbsp;► Phải mang theo Giấy b&aacute;o dự thi, chứng minh thư hoặc hộ chiếu (수험표, 신분증)<br />
&bull;&nbsp;&nbsp; &nbsp;► Xem kỹ c&aacute;c th&ocirc;ng tin c&aacute; nh&acirc;n tr&ecirc;n Giấy b&aacute;o dự thi, nếu kh&aacute;c với th&ocirc;ng tin trong chứng minh thư hoặc hộ chiếu th&iacute; sinh sẽ kh&ocirc;ng được dự thi.<br />
&nbsp;<br />
<strong><span style="color:#27ae60">2. C&aacute;c t&igrave;nh huống th&iacute; sinh dự thi TOPIK cần lưu &yacute; (시험 응시 관련)</span></strong><br />
&nbsp;<br />
Trước v&agrave; trong qu&aacute; tr&igrave;nh tham gia <strong>kỳ thi năng lực tiếng H&agrave;n TOPIK</strong>, sẽ c&oacute; rất nhiều c&aacute;c trường hợp m&agrave; th&iacute; sinh c&oacute; thể gặp phải. Để c&oacute; thể xử l&yacute; nhanh nhất v&agrave; kh&ocirc;ng bị lỡ mất kỳ thi, c&aacute;c bạn h&atilde;y đọc trước thật kỹ phần n&agrave;y:<br />
&bull;&nbsp;&nbsp; &nbsp;► Trường hợp th&iacute; sinh đ&atilde; đăng k&yacute; xin được ho&agrave;n trả lệ ph&iacute; thi th&igrave; sẽ kh&ocirc;ng được đến tham gia dự thi trong bất cứ ho&agrave;n cảnh n&agrave;o.<br />
&bull;&nbsp;&nbsp; &nbsp;► Th&iacute; sinh sẽ phải chịu tr&aacute;ch nhiệm trong qu&aacute; tr&igrave;nh thi v&agrave; l&agrave;m b&agrave;i thi theo đ&uacute;ng khoảng thời gian quy định.<br />
&bull;&nbsp;&nbsp; &nbsp;► Nếu kỳ thi c&oacute; chia <strong>đề thi tiếng H&agrave;n TOPIK</strong> chẵn v&agrave; lẻ, bạn cần ghi ch&iacute;nh x&aacute;c v&agrave;o trong Phiếu đ&aacute;p &aacute;n. V&igrave; gi&aacute;m thị chắc chắn sẽ c&oacute; kiểm tra bất thường về x&aacute;c thực đề chẵn, lẻ tr&ecirc;n đề. Nếu c&oacute; sai s&oacute;t phải b&aacute;o ngay nếu kh&ocirc;ng muốn rơi v&agrave;o t&igrave;nh trạng nghi vấn đổi đề.<br />
&bull;&nbsp;&nbsp; &nbsp;► Nếu th&iacute; sinh muốn bỏ thi giữa trường th&igrave; phải viết bản cam kết xin ngừng thi, sau đ&oacute; mới được ra khỏi ph&ograve;ng.<br />
&bull;&nbsp;&nbsp; &nbsp;► Với c&aacute;c bạn dự <strong>thi tiếng H&agrave;n TOPIK II </strong>m&agrave; vắng mặt ở ca 1 th&igrave; cũng đồng nghĩa kh&ocirc;ng được tham gia ca 2 v&agrave; kh&ocirc;ng được ho&agrave;n trả học ph&iacute;.<br />
&bull;&nbsp;&nbsp; &nbsp;► Nếu th&iacute; sinh kh&ocirc;ng c&oacute; mặt tại chỗ ngồi số b&aacute;o danh của m&igrave;nh sau khi c&oacute; th&ocirc;ng b&aacute;o thời gian v&agrave;o ph&ograve;ng thi đ&atilde; kết th&uacute;c, th&iacute; sinh đ&oacute; sẽ mất quyền tham dự v&agrave; kh&ocirc;ng được dự thi tại cơ sở n&agrave;o kh&aacute;c.</span><br />
&nbsp;</p>

<p style="text-align:center"><br />
<span style="font-size:14px">&nbsp;<img alt="" src="https://tomato-dev.ss-hn-1.vccloud.vn/files/upload/images/phieu-thi-topik.png" style="height:422px; width:600px" /></span></p>

<h3 style="text-align:center"><br />
<a href="http://tomatoonline.edu.vn/thi-topik-tieng-han-dieu-can-biet-p19.html"><span style="font-size:14px"><span style="color:#27ae60"><strong>C&aacute;ch điền phiếu đ&aacute;p &aacute;n để tr&aacute;nh bị mất điểm (답안지 작성 관련 안내)</strong></span></span></a></h3>

<p><br />
<span style="font-size:14px">&nbsp;<br />
Phiếu điền đ&aacute;p &aacute;n ch&iacute;nh l&agrave; thứ c&oacute; ảnh hưởng trực tiếp đến kết quả b&agrave;i thi của bạn. Ngo&agrave;i việc chọn được ch&iacute;nh x&aacute;c c&aacute;c đ&aacute;p &aacute;n đ&uacute;ng th&igrave; th&iacute; sinh cũng cần lưu &yacute; về c&aacute;ch t&ocirc;, về quy định điền phiếu đ&aacute;p &aacute;n ho&agrave;n chỉnh.<br />
V&agrave;o khoảng thời gian <strong>luyện thi TOPIK tiếng H&agrave;n</strong>, c&aacute;c bạn n&ecirc;n l&agrave;m đề thi thử k&egrave;m theo in c&aacute;c phiếu đ&aacute;p &aacute;n mẫu để luyện tập c&aacute;ch điền phiếu sao cho đ&uacute;ng. Kỹ năng n&agrave;y nh&igrave;n vậy nhưng cũng c&oacute; kh&aacute; nhiều c&aacute;c vấn đề m&agrave; bạn cần lưu t&acirc;m:</span></p>

<p><br />
<span style="font-size:14px">&bull;&nbsp;&nbsp; &nbsp;► Ở mỗi phần thi kỹ năng nghe, đọc hay viết th&igrave; bạn chỉ được ph&eacute;p điền phiếu đ&aacute;p &aacute;n của kỹ năng đ&oacute;. Nếu đang thi nghe m&agrave; bạn l&agrave;m đề của phần đọc hay viết th&igrave; sẽ bị gi&aacute;m thị đ&aacute;nh dấu b&agrave;i.<br />
&bull;&nbsp;&nbsp; &nbsp;► Tr&ecirc;n phiếu đ&aacute;p &aacute;n kh&ocirc;ng được c&oacute; bất cứ dấu hiệu n&agrave;o hoặc vẽ bậy l&ecirc;n phần mẫu &ocirc; tr&ograve;n đ&atilde; được t&ocirc; đen<br />
&bull;&nbsp;&nbsp; &nbsp;► Nếu th&iacute; sinh chọn đ&aacute;p &aacute;n m&agrave; chỉ khoang trong đề thi kh&ocirc;ng t&ocirc; đen trong phiếu đ&aacute;p &aacute;n th&igrave; dĩ nhi&ecirc;n c&acirc;u trả lời đ&oacute; sẽ kh&ocirc;ng được t&iacute;nh điểm.<br />
&bull;&nbsp;&nbsp; &nbsp;► <strong>Kỳ thi TOPIK tiếng H&agrave;n</strong> kh&aacute;c với c&aacute;c kỳ thi kh&aacute;c l&agrave; bạn sẽ kh&ocirc;ng phải mang theo b&uacute;t. Th&iacute; sinh sẽ chỉ được d&ugrave;ng loại b&uacute;t 2 đầu được gi&aacute;m thị ph&aacute;t. Trường hợp th&iacute; sinh cố t&igrave;nh d&ugrave;ng b&uacute;t kh&aacute;c, m&aacute;y kh&ocirc;ng nhận dạng được th&igrave; th&iacute; sinh tự chịu tr&aacute;ch nhiệm về kết quả của b&agrave;i thi.<br />
&bull;&nbsp;&nbsp; &nbsp;► Để điền phiếu đ&aacute;p &aacute;n của b&agrave;i thi tiếng H&agrave;n phần Nghe v&agrave; phần Đọc, th&iacute; sinh phải d&ugrave;ng loại b&uacute;t đầu to. V&agrave; lưu &yacute; phải t&ocirc; k&iacute;n đ&aacute;p &aacute;n &ldquo;●&rdquo;. Đ&atilde; c&oacute; rất nhiều bạn bị mất điểm oan ở phần n&agrave;y do t&ocirc; đ&aacute;p &aacute;n qu&aacute; mờ, m&aacute;y chấm thi kh&ocirc;ng nhận diện được kết quả.<br />
&bull;&nbsp;&nbsp; &nbsp;► Ri&ecirc;ng với phần <strong>thi Viết tiếng H&agrave;n</strong>, th&iacute; sinh sẽ l&agrave;m b&agrave;i với b&uacute;t đầu nhỏ. Gi&aacute;m thị sẽ ph&aacute;t cho bạn c&aacute;c phần giấy quy định để l&agrave;m b&agrave;i thi viết, v&igrave; thế nếu c&aacute;c c&acirc;u chữ nằm ngo&agrave;i phần giấy n&agrave;y sẽ kh&ocirc;ng được t&iacute;nh. Phần thi n&agrave;y cho ph&eacute;p sử dụng b&uacute;t x&oacute;a, n&ecirc;n c&aacute;c bạn c&oacute; thể dơ tay để ra hiệu cần sự hỗ trợ từ gi&aacute;m thị.<br />
&bull;&nbsp;&nbsp; &nbsp;► Th&iacute; sinh c&oacute; thể xin tờ Phiếu đ&aacute;p &aacute;n mới để l&agrave;m lại b&agrave;i<br />
&bull;&nbsp;&nbsp; &nbsp;► Th&iacute; sinh muốn ra khỏi ph&ograve;ng thi th&igrave; phải nghe b&aacute;o hiệu hết giờ. <strong>Đề thi tiếng H&agrave;n TOPIK</strong> c&ugrave;ng với phiếu đ&aacute;p &aacute;n sẽ được gi&aacute;m thị thu lại.</span></p>

