<p><span style="font-size:14px">Đ&acirc;y kh&ocirc;ng chỉ l&agrave; cơ hội để bạn t&igrave;m kiếm một tấm bằng cho c&ocirc;ng việc tương lai, m&agrave; c&ograve;n l&agrave; c&aacute;ch gi&uacute;p để bạn nhận biết năng lực tiếng Nhật hi&ecirc;n tại của ch&iacute;nh bạn,&nbsp;kế hoạch n&acirc;ng cao tr&igrave;nh độ tiếng Nhật&nbsp;</span></p>

<h1><br />
<span style="font-size:14px">&nbsp;<span style="color:#27ae60"><strong> &nbsp;<a href="http://tomatoonline.edu.vn/ky-thi-nang-luc-tieng-nhat-jlpt-p21.html">B&Iacute; K&Iacute;P &Ocirc;N LUYỆN TIẾNG NHẬT&nbsp;HIỆU QUẢ&nbsp;&nbsp;KỲ THI JLPT</a></strong></span></span></h1>

<p><br />
<span style="font-size:14px"><span style="color:#2980b9"><strong>1.&nbsp; KỲ THI JLPT l&agrave; g&igrave;?</strong></span><br />
Tất tần tật những điều bạn cần biết về kỳ thi năng lực tiếng Nhật JLPT</span><br />
&nbsp;</p>

<p><span style="font-size:14px">日本語能力試験（にほんごのうりょくしけん) hay t&ecirc;n trong tiếng Anh l&agrave; Japanese Language Proficiency Test (JLPT), tiếng Việt gọi l&agrave; kỳ thi Năng Lực Tiếng Nhật. Đ&acirc;y l&agrave; kỳ thi đ&aacute;nh gi&aacute; tiếng Nhật nổi tiếng, phổ biến v&agrave; c&oacute; uy t&iacute;n nhất hiện hay. JLPT được tổ chức bởi Japan Foundation (国際交流基金 &ndash; こくさいこうりゅうききん), một tổ chức thuộc Bộ Ngoại Giao Nhật Bản. Hiện tại JLPT được tổ chức h&agrave;ng năm tại 65 quốc gia v&agrave; v&ugrave;ng l&atilde;nh thổ tr&ecirc;n to&agrave;n thế giới.<br />
Hiện tại, kỳ thi Năng lực Tiếng Nhật (Năng lực Nhật ngữ, hay Japanese Language Proficiency Test) được tổ chức với 5 cấp bậc từ N1 (kh&oacute; nhất) tới N5 (dễ nhất).<br />
Đối tượng tham gia: Tất cả mọi người kh&ocirc;ng c&oacute; ng&ocirc;n ngữ mẹ đẻ l&agrave; tiếng Nhật đều c&oacute; thể tham gia kỳ thi năng lực tiếng Nhật JLPT, kh&ocirc;ng ph&acirc;n biệt tuổi t&aacute;c, d&acirc;n tộc, t&ocirc;n gi&aacute;o hay giới t&iacute;nh.</span></p>

<p>&nbsp;</p>

<h2><span style="color:#2980b9"><strong><span style="font-size:14px">&nbsp;<a href="http://tomatoonline.edu.vn/ky-thi-nang-luc-tieng-nhat-jlpt-p21.html">C&aacute;c cấp độ của kỳ thi năng lực tiếng Nhật JLPT</a></span></strong></span></h2>

<p><br />
<span style="font-size:14px">N1&nbsp;&nbsp; &nbsp;C&oacute; thể hiểu tiếng Nhật trong c&aacute;c t&igrave;nh huống đa dạng.<br />
Đọc&nbsp;&nbsp; &nbsp;* C&oacute; thể đọc b&igrave;nh luận b&aacute;o ch&iacute; viết về c&aacute;c đề t&agrave;i đa dạng, đọc văn viết hơi phức tạp về mặt l&yacute; luận, văn viết c&oacute; độ trừu tượng cao v&agrave; hiểu cấu tr&uacute;c cũng như nội dung b&agrave;i văn.<br />
* C&oacute; thể đọc c&aacute;c b&agrave;i c&oacute; nội dung s&acirc;u về nhiều chủ đề, hiểu d&ograve;ng chảy c&acirc;u chuyện v&agrave; c&aacute;ch diễn đạt.<br />
Nghe&nbsp;&nbsp; &nbsp;* C&oacute; thể hiểu chi tiết d&ograve;ng chảy c&acirc;u chuyện, nội dung c&acirc;u chuyện quan hệ giữa c&aacute;c nh&acirc;n vật v&agrave; cấu tr&uacute;c l&yacute; luận của nội dung khi nghe c&aacute;c b&agrave;i n&oacute;i như hội thoại, tin tức, b&agrave;i giảng ở c&aacute;c t&igrave;nh huống đa dạng.</span></p>

<p><br />
<span style="font-size:14px">N2&nbsp;&nbsp; &nbsp;Hiểu tiếng Nhật trong c&aacute;c t&igrave;nh huống h&agrave;ng ng&agrave;y, th&ecirc;m v&agrave;o đ&oacute; c&oacute; thể hiểu ở mức n&agrave;o đ&oacute; tiếng Nhật trong c&aacute;c t&iacute;nh huống đa dạng.<br />
Đọc&nbsp;&nbsp; &nbsp;* C&oacute; thể đọc đoạn văn c&oacute; chủ đề r&otilde; r&agrave;ng, hiểu nội dung như c&aacute;c b&agrave;i b&aacute;o, b&agrave;i tạp ch&iacute;, b&agrave;i giải nghĩa, b&igrave;nh luận đơn giản&hellip; về c&aacute;c chủ đề đa dạng.<br />
* C&oacute; thể đọc c&aacute;c b&agrave;i viết về c&aacute;c chủ đề chung, hiểu d&ograve;ng chảy c&acirc;u chuyện v&agrave; &yacute; đồ diễn đạt.<br />
Nghe&nbsp;&nbsp; &nbsp;* C&oacute; thể nghe c&aacute;c t&igrave;nh huống thường ng&agrave;y v&agrave; c&aacute;c b&agrave;i n&oacute;i tự nhi&ecirc;n trong c&aacute;c t&igrave;nh huống đa dạng như hội thoại, tin tức, hiểu d&ograve;ng chảy c&acirc;u chuyện, nội dung, quan hệ giứa c&aacute;c nh&acirc;n vật, nắm được &yacute; ch&iacute;nh.</span></p>

<p><br />
<span style="font-size:14px">N3&nbsp;&nbsp; &nbsp;C&oacute; thể hiểu ở mức nhất định tiếng Nhật d&ugrave;ng trong c&aacute;c t&igrave;nh huống h&agrave;ng ng&agrave;y.<br />
Đọc&nbsp;&nbsp; &nbsp;* C&oacute; thể đọc hiểu văn chương diễn đạt nội dung cụ thể về c&aacute;c vấn đề h&agrave;ng ng&agrave;y.<br />
* C&oacute; thể nắm bắt kh&aacute;i qu&aacute;t th&ocirc;ng tin từ ti&ecirc;u đề b&aacute;o ch&iacute;.<br />
* C&oacute; thể hiểu văn chương hơi kh&oacute; trong phạm vi nh&igrave;n thấy trong c&aacute;c t&igrave;nh<br />
huống h&agrave;ng ng&agrave;y nếu được n&oacute;i diễn đạt lại theo c&aacute;ch kh&aacute;c.<br />
Nghe&nbsp;&nbsp; &nbsp;* C&oacute; thể hiểu nội dung cụ thể của c&acirc;u chuyện cũng như quan hệ c&aacute;c nh&acirc;n vật khi nghe hội thoại c&oacute; chủ đề trong n&oacute;i chuyện tự nhi&ecirc;n h&agrave;ng ng&agrave;y.</span></p>

<p><br />
<span style="font-size:14px">N4&nbsp;&nbsp; &nbsp;C&oacute; thể hiểu tiếng Nhật căn bản.<br />
Đọc&nbsp;&nbsp; &nbsp;* C&oacute; thể đọc hiểu văn chương hay d&ugrave;ng h&agrave;ng ng&agrave;y viết bằng những từ vựng v&agrave; chữ Kanji cơ bản.<br />
Nghe&nbsp;&nbsp; &nbsp;* C&oacute; thể hiểu nội dung hội thoại trong t&igrave;nh huống h&agrave;ng ng&agrave;y nếu n&oacute;i chậm.</span></p>

<p><br />
<span style="font-size:14px">N5&nbsp;&nbsp; &nbsp;C&oacute; thể hiểu ở mức n&agrave;o đ&oacute; tiếng Nhật căn bản.<br />
Đọc&nbsp;&nbsp; &nbsp;* C&oacute; thể đọc hiểu cụm từ, c&acirc;u, đoạn văn dạng cố định viết bằng chữ Hiragana, chữ Katakana, chữ H&aacute;n cơ bản d&ugrave;ng trong sinh hoạt h&agrave;ng ng&agrave;y.<br />
Nghe&nbsp;&nbsp; &nbsp;* C&oacute; thể nghe được th&ocirc;ng tin cần thiết trong hội thoại ngắn, n&oacute;i chậm trong c&aacute;c t&igrave;nh huống hay gặp h&agrave;ng ng&agrave;y như lớp học, cuộc sống xung quanh.<br />
Trước đ&acirc;y, kỳ thi năng lực tiếng Nhật (JLPT) được chỉ được chia th&agrave;nh 4 cấp độ chứ kh&ocirc;ng phải 5 cấp độ (N5~N1) như hiện nay. Đ&oacute; l&agrave; Cấp độ 1 (1-kyuu), cấp độ 2 (2-kyuu), cấp độ 3 (3-kyuu), cấp độ 4 (4-kyuu). Sự kh&aacute;c nhau giữa c&aacute;c cấp độ mới </span></p>

<p><span style="font-size:14px">(N=New, Nihongo) v&agrave; c&aacute;c cấp độ cũ như sau:<br />
N1: Giống cấp độ 1-kyuu cũ nhưng cao hơn một ch&uacute;t. Điểm đỗ giống nhau.<br />
N2: Hầu như giống cấp độ 2-kyuu cũ.<br />
N3: L&agrave; cấp độ trung gian giữa 2-kyu v&agrave; 3-kyuu cũ. (CẤP ĐỘ MỚI ĐƯỢC MỞ TH&Ecirc;M)<br />
N4: Hầu như giống cấp độ 3-kyuu cũ.<br />
N5: Hầu như giống cấp độ 4-kyuu cũ.<br />
Nếu bạn n&agrave;o đ&atilde; c&oacute; 1-kyuu hay 2-kyuu th&igrave; bạn cũng sẽ đang c&oacute; tr&igrave;nh độ N1 hoặc N2. C&ograve;n nếu bạn đang c&oacute; 3-kyuu th&igrave; bạn c&oacute; tr&igrave;nh độ N4, nếu bạn c&oacute; 4-kyuu th&igrave; bạn c&oacute; tr&igrave;nh độ N5.</span></p>

<p><br />
<span style="font-size:14px"><span style="color:#2980b9"><strong>3. Đ&aacute;nh gi&aacute; định lượng (ước lượng) c&aacute;c cấp độ</strong></span><br />
Tất tần tật những điều bạn cần biết về kỳ thi năng lực tiếng Nhật JLPT<br />
Nguồn: T&agrave;i liệu của JEES (Hiệp hội Hỗ trợ Gi&aacute;o dục Quốc Tế Nhật Bản)</span></p>

<p><span style="font-size:14px">Tổng kết nội dung kỳ thi JLPT mới: Số liệu ước lượng từ t&agrave;i liệu của JEES</span></p>

<p><span style="font-size:14px">&nbsp;<br />
Cấp độ&nbsp;&nbsp; &nbsp;Kanji&nbsp;&nbsp; &nbsp;Từ vựng&nbsp;&nbsp; &nbsp;Nghe&nbsp;&nbsp; &nbsp;Số giờ học<br />
N5&nbsp;&nbsp; &nbsp;~100&nbsp;&nbsp; &nbsp;~800&nbsp;&nbsp; &nbsp;Beginner (Bắt đầu)&nbsp;&nbsp; &nbsp;150 (ước lượng)<br />
N4&nbsp;&nbsp; &nbsp;~300&nbsp;&nbsp; &nbsp;~1,500&nbsp;&nbsp; &nbsp;Basic (Cơ bản)&nbsp;&nbsp; &nbsp;300 (ước lượng)<br />
N3&nbsp;&nbsp; &nbsp;~650&nbsp;&nbsp; &nbsp;~3,750&nbsp;&nbsp; &nbsp;Lower Intermediate (Sơ cấp)&nbsp;&nbsp; &nbsp;450 (ước lượng)<br />
N2&nbsp;&nbsp; &nbsp;~1000&nbsp;&nbsp; &nbsp;~6,000&nbsp;&nbsp; &nbsp;Intermediate (Trung cấp)&nbsp;&nbsp; &nbsp;600 (ước lượng)<br />
N1&nbsp;&nbsp; &nbsp;~2000&nbsp;&nbsp; &nbsp;~10,000&nbsp;&nbsp; &nbsp;Advanced (Cao cấp)&nbsp;&nbsp; &nbsp;900 (ước lượng)</span></p>

<p><br />
<span style="font-size:14px"><span style="color:#2980b9"><strong>Một số n&eacute;t mới kỳ thi JLPT&nbsp;</strong></span></span></p>

<p><br />
<span style="font-size:14px">Kỳ thi năng lực tiếng Nhật mới sẽ d&ugrave;ng điểm được chuẩn h&oacute;a (得点等化), l&agrave; phương ph&aacute;p để đ&aacute;nh gi&aacute; c&ocirc;ng bằng điểm số trong c&aacute;c kỳ thi với nhau. V&iacute; dụ kỳ thi thời điểm A bạn thi được 130 điểm do đề dễ, nhưng kỳ thi thời điểm B bạn chỉ được 120 điểm do đề kh&oacute;. Chuẩn h&oacute;a điểm số l&agrave; phương ph&aacute;p so s&aacute;nh (bằng thống k&ecirc;) 2 kỳ thi với nhau để chuẩn h&oacute;a điểm về một thang chung. Do đ&oacute; bạn thi kỳ thi n&agrave;o cũng hầu như cho số điểm (đ&atilde; được chuẩn h&oacute;a) ngang nhau.<br />
Ngo&agrave;i ra, bạn sẽ được gửi kết quả l&agrave; một danh s&aacute;ch những khả năng của bạn (v&iacute; du: Viết: C&oacute; thể mi&ecirc;u tả cảm x&uacute;c&hellip;) trong tiếng Nhật.<br />
Xem th&ecirc;m: Tổng hợp bộ đề thi thử v&agrave; đ&aacute;p &aacute;n JLPT N5</span></p>

<h2><br />
<a href="http://tomatoonline.edu.vn/ky-thi-nang-luc-tieng-nhat-jlpt-p21.html"><span style="font-size:14px"><span style="color:#2980b9"><strong>&nbsp;C&aacute;c m&ocirc;n thi v&agrave; thời gian thi JLPT</strong></span>&nbsp;</span></a></h2>

<p><br />
<span style="font-size:14px">Bạn c&oacute; thể xem bảng dưới đ&acirc;y, trong đ&oacute; c&oacute; 3 phần:<br />
言語知識（文字・語彙・文法）： Kiến thức ng&ocirc;n ngữ (Chữ, Từ vựng, Ngữ ph&aacute;p)<br />
読解： Đọc hiểu<br />
聴解： Nghe hiểu<br />
Tất tần tật những điều bạn cần biết về kỳ thi năng lực tiếng Nhật JLPT<br />
Tất tần tật những điều bạn cần biết về kỳ thi năng lực tiếng Nhật JLPT</span></p>

<p><span style="font-size:14px">Cấp N1 v&agrave; N2 thi kiến thức ng&ocirc;n ngữ (chữ, từ vựng, ngữ ph&aacute;p) v&agrave; đọc hiểu chung. C&ograve;n N3, N4, N5 th&igrave; chia l&agrave;m hai phần. Phần 1 l&agrave; kiến thức ng&ocirc;n ngữ gồm chữ, từ vựng. Phần 2 l&agrave; kiến thức ng&ocirc;n ngữ về ngữ ph&aacute;p v&agrave; đọc hiểu.<br />
C&aacute;c cấp từ N5~N1 đều c&oacute; thi nghe hiểu ri&ecirc;ng.</span></p>

<h3><br />
<span style="font-size:14px"><strong><span style="color:#2980b9"><a href="http://tomatoonline.edu.vn/kien-thuc-huong-dan-cach-hoc-ngoai-ngu-ct10.html">Điểm số c&aacute;c phần thi tiếng Nhật</a>&nbsp;</span></strong></span></h3>

<p><br />
<span style="font-size:14px">Điểm c&aacute;c phần thi năng lực tiếng Nhật như trong bảng sau:<br />
Tất tần tật những điều bạn cần biết về kỳ thi năng lực tiếng Nhật JLPT<br />
Tất tần tật những điều bạn cần biết về kỳ thi năng lực tiếng Nhật JLPT</span></p>

<p><span style="font-size:14px">C&aacute;c phần thi đều c&oacute; tổng điểm trong phạm vi 0 ~ 180, trong đ&oacute;:<br />
Cấp N1, N2, N3:<br />
Kiến thức ng&ocirc;n ngữ (Chữ, từ vựng, ngữ ph&aacute;p): 0 ~ 60<br />
Đọc hiểu: 0 ~ 60.<br />
Nghe hiểu: 0 ~ 60.<br />
Cấp N4, N5:<br />
Kiến thức ng&ocirc;n ngữ (Chữ, từ vựng, ngữ ph&aacute;p) &ndash; Đọc hiểu: 0 ~ 120.<br />
Nghe hiểu: 0 ~ 60.</span></p>

<p><br />
<span style="font-size:14px"><span style="color:#2980b9"><strong>7. Thế n&agrave;o l&agrave; thi đậu kỳ thi năng lực tiếng Nhật JLPT?</strong></span><br />
Tr&igrave;nh độ tiếng Nhật&nbsp;&nbsp; &nbsp;Ti&ecirc;u ch&iacute;<br />
N1&nbsp;&nbsp; &nbsp;<br />
Điểm tổng: Tr&ecirc;n 100 điểm (Tối đa: 180).<br />
Điểm kiến thức ng&ocirc;n ngữ (Chữ, từ vựng, ngữ ph&aacute;p): Tr&ecirc;n 19 điểm (Tối đa: 60).<br />
Điểm đọc hiểu: Tr&ecirc;n 19 điểm (Tối đa: 60).<br />
Điểm nghe hiểu: Tr&ecirc;n 19 điểm (Tối đa: 60).<br />
N2&nbsp;&nbsp; &nbsp;<br />
Điểm tổng: Tr&ecirc;n 90 điểm (Tối đa: 180).<br />
Điểm kiến thức ng&ocirc;n ngữ (Chữ, từ vựng, ngữ ph&aacute;p): Tr&ecirc;n 19 điểm (Tối đa: 60).<br />
Điểm đọc hiểu: Tr&ecirc;n 19 điểm (Tối đa: 60).<br />
Điểm nghe hiểu: Tr&ecirc;n 19 điểm (Tối đa: 60).<br />
N3&nbsp;&nbsp; &nbsp;<br />
Điểm tổng: Tr&ecirc;n 95 điểm (Tối đa: 180).<br />
Điểm kiến thức ng&ocirc;n ngữ (Chữ, từ vựng, ngữ ph&aacute;p): Tr&ecirc;n 19 điểm (Tối đa: 60).<br />
Điểm đọc hiểu: Tr&ecirc;n 19 điểm (Tối đa: 60).<br />
Điểm nghe hiểu: Tr&ecirc;n 19 điểm (Tối đa: 60).<br />
N4&nbsp;&nbsp; &nbsp;<br />
Điểm tổng: Tr&ecirc;n 90 điểm (Tối đa: 180)<br />
Điểm kiến thức ng&ocirc;n ngữ &amp; Đọc hiểu: Tr&ecirc;n 38 điểm (Tối đa: 120)<br />
Điểm nghe hiểu: Tr&ecirc;n 19 điểm (Tối đa: 60)<br />
N5&nbsp;&nbsp; &nbsp;<br />
Điểm tổng: Tr&ecirc;n 80 điểm (Tối đa: 180).<br />
Điểm kiến thức ng&ocirc;n ngữ &amp; Đọc hiểu: Tr&ecirc;n 38 điểm (Tối đa: 120).<br />
Điểm nghe hiểu: Tr&ecirc;n 19 điểm (Tối đa: 60).<br />
Ch&uacute; &yacute; l&agrave; kh&aacute;c với kỳ thi JLPT trước đ&acirc;y (chỉ cần điểm tổng lớn hơn điểm đậu), kỳ thi JLPT mới ngo&agrave;i y&ecirc;u cầu điểm tổng phải lớn hơn mức đậu, c&ograve;n y&ecirc;u cầu điểm th&agrave;nh phần phải lớn hơn mức chuẩn (v&iacute; dụ điểm chuẩn của Đọc hiểu l&agrave; 19 điểm, điểm chuẩn của Nghe hiểu l&agrave; 19 điểm).<br />
Điểm đậu kỳ thi JLPT cũ:<br />
1-kyuu: Tr&ecirc;n 70%, tức l&agrave; tr&ecirc;n 280 điểm. Điểm tối đa: 400 điểm.<br />
2-kyuu, 3-kyuu, 4-kyuu: Tr&ecirc;n 60%, tức l&agrave; tr&ecirc;n 240 điểm. Tối đa: 400 điểm.<br />
Xem th&ecirc;m:B&iacute; quyết đọc hiểu tiếng Nhật &ldquo;si&ecirc;u hiệu quả&rdquo;</span></p>

<p><span style="color:#2980b9"><span style="font-size:14px"><strong>&nbsp;8. Kỳ thi JLPT được tổ chức khi n&agrave;o? Xem ng&agrave;y thi v&agrave; thời hạn đăng k&yacute; ở đ&acirc;u?</strong></span></span></p>

<p><br />
<span style="font-size:14px">Ở Việt Nam, kỳ thi JLPT được tổ chức v&agrave;o th&aacute;ng 7 v&agrave; th&aacute;ng 12 ở H&agrave; Nội, Th&agrave;nh phố Hồ Ch&iacute; Minh, Đ&agrave; Nẵng v&agrave; Huế.</span></p>

<p><span style="font-size:14px">Nơi xin hồ sơ:</span></p>

<p><span style="font-size:14px">H&agrave; Nội:</span></p>

<p><span style="font-size:14px">Đại học Ngoại ngữ &ndash; Đại học Quốc gia H&agrave; nội (số 1, Phạm Văn Đồng, Cầu Giấy).<br />
Đại học H&agrave; Nội (Nguyễn Tr&atilde;i, Văn Qu&aacute;n, H&agrave; Đ&ocirc;ng).<br />
Th&agrave;nh phố Hồ Ch&iacute; Minh:</span></p>

<p><span style="font-size:14px">Đại học Khoa học x&atilde; hội v&agrave; nh&acirc;n văn (12 Đinh Ti&ecirc;n Ho&agrave;ng, Quận 1)<br />
Đ&agrave; Nẵng:</span></p>

<p><span style="font-size:14px">Đại học Ngoại ngữ &ndash; Đại học Đ&agrave; Nẵng (131 Lương Nhữ Hộc, Cẩm Lệ)<br />
Huế:</span></p>

<p><span style="font-size:14px">Đại học Ngoại ngữ Huế (57 Nguyễn Khoa Chi&ecirc;m, phường An Cựu, Tp. Huế)</span></p>

<h4><br />
<a href="http://tomatoonline.edu.vn/kien-thuc-huong-dan-cach-hoc-ngoai-ngu-ct10.html"><span style="font-size:14px"><span style="color:#2980b9"><strong>&nbsp;L&agrave;m thế n&agrave;o để đăng k&yacute; thi năng lực tiếng Nhật JLPT? Khi n&agrave;o c&oacute; kết quả?</strong></span></span></a></h4>

<p><br />
<span style="font-size:14px">C&aacute;c bước như sau:<br />
