2. Đăng k&yacute; thi, trả tiền lệ ph&iacute; thi.<br />
Thời gian đăng k&yacute;:<br />
Kỳ thi th&aacute;ng 7 đăng k&yacute; v&agrave;o th&aacute;ng 3 ~ th&aacute;ng 4.<br />
Kỳ thi th&aacute;ng 12 đăng k&yacute; v&agrave;o th&aacute;ng 8 ~ th&aacute;ng 9.<br />
Trả kết quả:<br />
Kỳ thi th&aacute;ng 7: Khoảng th&aacute;ng 9.<br />
Kỳ thi th&aacute;ng 12: Khoảng th&aacute;ng 3.</span></p>
