<p><strong>* Ghi ch&uacute;:</strong></p>

<p>- Bất luận học gi&aacute;o tr&igrave;nh g&igrave;, điều quan trọng l&agrave;: năng lực sư phạm truyền đạt của gi&aacute;o vi&ecirc;n v&agrave; sự nỗ lực của bản th&acirc;n. Học trực tiếp ở trung t&acirc;m ( hoặc trực tuyến ) th&igrave; học Boya c&ograve;n mua kh&oacute;a học b&aacute;n sẵn th&igrave; H&aacute;n ngữ cơ sở hoặc Boya. Học gi&aacute;o tr&igrave;nh n&agrave;o cũng c&oacute; thể: &ocirc;n thi v&agrave; thi hsk, giao tiếp.</p>

<p>- Trong qu&aacute; tr&igrave;nh dạy, gi&aacute;o vi&ecirc;n căn cứ năng lực thực tế v&agrave; kiến thức đ&atilde; học để cho học vi&ecirc;n l&agrave;m c&aacute;c đề thi thử HSK qua đ&oacute; đ&aacute;nh gi&aacute; tr&igrave;nh độ. Ngo&agrave;i ra, học sinh c&oacute; thể l&agrave;m c&aacute;c đề thi hsk online( phần n&agrave;y do anh Nam lớn phụ tr&aacute;ch) tr&ecirc;n website để biết m&igrave;nh đang ở tr&igrave;nh độ HSK n&agrave;o, qua đ&oacute; lựa chọn tr&igrave;nh độ học cho ph&ugrave; hợp.</p>

